  getChildren(accountAddress, partners = []) {
    const parentAccount = this.oldUserData.find(
      (d) =>
        String(d?.accountAddress).toLowerCase() ===
        accountAddress.toLowerCase(),
    );

    console.log(parentAccount);

    const children = this.oldUserData.filter(
      (d) =>
        String(d?.referredBy).toLowerCase() ===
        parentAccount?.accountAddress.toLowerCase(),
    );
    partners = children;

    if (children.length <= 0) {
      return partners;
    }

    for (const child of children) {
      const _children = this.getChildren(child?.accountAddress, partners);
      partners = [...partners, ..._children];
    }
    return partners;
  }

  async registerOldUsers() {
    Logger.log(
      '++++++++++++++++++++++++++++ OLD USER IMPORT STARTED ++++++++++++++++++++++++++++',
    );
    let counter = 0;
    for (const user of this.oldUserData) {
      counter++;
      if (this.skipAccount.includes(user?.accountAddress)) {
        console.log('userSkipped', counter, user?.accountAddress);
        continue;
      }
      const oldDataFromSheet2 = this.oldDataFromSheet2.find(
        (_oldDataFromSheet2) => {
          return (
            String(_oldDataFromSheet2?.account_address).toLowerCase() ===
            String(user?.accountAddress).toLowerCase()
          );
        },
      );

      const userSaved = await this.usersService.register(
        {
          walletAddress: user?.accountAddress,
          email: user?.email || 'common-admin@cubixpro.io',
          parent: user?.parent,
          referredBy: user?.referredBy,
          team: user?.team,
          userName: user?.userName,
          code: '',
          directSponsorBonus: oldDataFromSheet2?.individualIncome,
          businessIncome: oldDataFromSheet2?.businessIncome,
          businessIncomeFirst: oldDataFromSheet2?.businessIncomeFirst,
          businessIncomeSecond: oldDataFromSheet2?.businessIncomeSecond,
        },
        true,
      );

      console.log(
        'userSaved',
        counter,
        userSaved?.accountAddress,
        userSaved?.walletAddress,
      );
    }
    Logger.log(
      '++++++++++++++++++++++++++++ OLD USER IMPORT DONE ++++++++++++++++++++++++++++',
    );
  }

  async buyOldUserPack() {
    Logger.log(
      '++++++++++++++++++++++++++++ OLD PACK IMPORT START ++++++++++++++++++++++++++++',
    );
    const packRepo = await this.databaseService.getPackRepository();
    const packs = await packRepo.find();
    let counter = 0;
    for (const _pack of this.oldPackData) {
      counter++;
      console.log('counter', counter);

      const user: any = this.oldUserData.find(
        (_od) => _od?.memb_code === _pack?.MEMB_CODE,
      );
      if (this.skipAccount.includes(user?.accountAddress)) {
        console.log('userSkipped', counter, user?.accountAddress);
        continue;
      }
      const packId = packs?.find(
        (pack) => pack?.price === _pack.packPrice,
      )?._id;
      await this.usersService.buyPack({
        packId,
        accountAddress: user?.accountAddress,
        legacyUserPack: true,
      });
      console.log('pacSaved', counter, packId, user?.accountAddress);
    }

    Logger.log(
      '++++++++++++++++++++++++++++ OLD PACK IMPORT DONE ++++++++++++++++++++++++++++',
    );
  }

  async syncUserBusiness() {
    Logger.log(
      '++++++++++++++++++++++++++++ OLD USER SYNC START ++++++++++++++++++++++++++++',
    );
    const userRepo = await this.databaseService.getUserRepository();
    const users = await userRepo.find({
      where: {
        legacyUsers: true,
      },
    });
    let counter = 0;
    for (const user of users) {
      counter++;

      console.log('counter', counter);
      const oldDataFromSheet2 = this.oldDataFromSheet2.find(
        (_oldDataFromSheet2) => {
          return (
            String(_oldDataFromSheet2?.username).toLowerCase() ===
            String(user?.userName).toLowerCase()
          );
        },
      );

      if (oldDataFromSheet2?.account_address) {
        console.log(oldDataFromSheet2);

        await userRepo.update(
          {
            id: user?.id,
          },
          {
            businessIncomeFirstTeam: Number(
              oldDataFromSheet2.businessIncomeFirst,
            ),
            businessIncomeSecondTeam: Number(
              oldDataFromSheet2.businessIncomeSecond,
            ),
            rankBusinessATeamBucket: Number(
              oldDataFromSheet2.businessIncomeFirst,
            ),
            rankBusinessBTeamBucket: Number(
              oldDataFromSheet2.businessIncomeSecond,
            ),
          },
        );

        const rank = await this.bonusService.getUserCurrentLevel(user);
        if (rank) {
          await userRepo.update(
            {
              id: user?.id,
            },
            {
              profile: rank,
            },
          );
        }
        console.log('userUpdated', counter, user?.id, user?.accountAddress);
      }
    }

    Logger.log(
      '++++++++++++++++++++++++++++ OLD USER SYNC DONE ++++++++++++++++++++++++++++',
    );
  }

